import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import PesquisaJogador from './components/PesquisarAtletas';
import Favoritos from './components/Favoritos';

function App() {
  const [favoritos, setFavoritos] = useState([]);

  const handleAddToFavorites = (jogador) => {
    setFavoritos([...favoritos, jogador]);
  };

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route
            path="/"
            element={<PesquisaJogador onAddToFavorites={handleAddToFavorites} />}
          />
          <Route path="/favoritos" element={<Favoritos favoritos={favoritos} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
